import React from 'react'
import Button from "./Button";
const GameOver = () => {
    function reload() {
        window.location.reload(false);
      }
    return (
        <>
          <p class_Name='GameOver'> Game Over!</p>
          <Button name = "reload" class_Name = "reload" id='reload' onClick = {reload} />
        </>
    )
}

export default GameOver
